public class Main {
	public static boolean CheckRepeat(int n,int a[]) {
		int i,j;
		for(i=0;i<n-1;i++) {
			for(j=i+1;j<n;j++) {
				if(a[i]==a[j]) {
					return true;
				}
			}
		}
		return false;
	}
