            System.out.printf("INPUT ERROR.");
        else
        for(int i=1;i<=n;i++)
        {
            for(int j=1;j<=i;j++)
            {
                if(j!=i)
                    System.out.printf("%dX%d=%d\t",i,j,i*j);
                else
                    System.out.printf("%dX%d=%d",i,j,i*j);
        }
            System.out.println();
        }
    }
